import React from "react";
import { Container, Typography } from "@mui/material";

const AdminPage = () => {
  return (
    <Container>
      <Typography variant="h4">Admin Dashboard</Typography>
      <Typography>Welcome, Admin! You have full access.</Typography>
    </Container>
  );
};

export default AdminPage;
